// SPDX-License-Identifier: MIT
pragma solidity ^0.8.1;

import "./Utils.sol";

contract Auction {
    using Utils for *;
    uint oneDay = 1440;
    uint threeMonths = 7889231;

    enum State {
        ReadyForHiddenBids,
        ReadyForOpenBids,
        Closed,
        TokenRetrieved
    }

    modifier inState(State expectedState) {
        require(auctionInfo.currentState == expectedState, "Invalid state");
        _;
    }

    modifier isBeforeDeadline(uint deadline) {
        require(currentTime() < deadline, "Cannot bid after deadline");
        _;
    }

    modifier isAfterDeadline(uint deadline) {
        require(currentTime() > deadline, "Cannot close round before the deadline");
        _;
    }

    struct AuctionInfo {
        State currentState;
        address payable seller;
        uint energyAmount;
        uint minBidValue;
        uint depositValue;
        uint hiddenBidsDeadline;
        uint openBidsDeadline;
        uint tokenValidUntil;
    }

    struct Bid {
        bool existsHiddenBid;
        bytes32 hiddenBid;
        uint openBid;
        bool isOpenBidValid;
        uint deposit;
    }

    struct Token {
        address winner;
        address auctionContract;
        uint energyAmount;
        uint createdAt;
        uint validUntil;
        bool exists;
    }

    address controller;
    AuctionInfo public auctionInfo;
    address public winnerAddress;
    uint public winnerBid;

    mapping(address => Bid) public bids;
    mapping(address => Token) private token;
    address[] public hiddenBidsAddresses;
    address[] public openBidsAddresses;

    event CreatedNewAuction(AuctionInfo auctionInfo, uint currentTime);
    event ReceivedHiddenBid(address bidder, bytes32 hiddenBid, uint deposit, uint contractBalance, uint currentTime);
    event ReceivedOpenBid(address bidder, uint bid, uint currentTime);
    event ClosedRound(string whichRound, State state, uint currentTime);
    event FoundHighestBid(address winnerAddress, uint highestBid, uint currentTime);
    event AuctionEnded(address winnerAddress, uint highestBid, uint contractBalance, uint currentTime);
    event TransferEvent(string context, address to, uint value, uint currentTime);
    event RetrievedToken(address retrievedBy, uint currentTime);

    // msg.sender is the controller controller and not the seller address
    // Seller address must therefore be specified as a parameter
    constructor(
        address payable _seller, 
        uint _energyAmount, 
        uint _minBidValue, 
        uint _depositValue,
        uint _deadline
    ) {
        controller = msg.sender;
        auctionInfo = AuctionInfo({
            currentState: State.ReadyForHiddenBids,
            seller: _seller,
            energyAmount: _energyAmount,
            minBidValue: _minBidValue * 1 wei,
            depositValue: _depositValue * 1 wei,
            hiddenBidsDeadline: currentTime() + Utils.minutesToSeconds(_deadline),
            openBidsDeadline: currentTime() + Utils.minutesToSeconds(_deadline * 2),
            // hiddenBidsDeadline: currentTime() + Utils.minutesToSeconds(oneDay),
            // openBidsDeadline: currentTime() + Utils.minutesToSeconds(oneDay * 2),
            tokenValidUntil: 0
        });

        emit CreatedNewAuction(auctionInfo, currentTime());
    }

    /// Place a hidden bid by hashing it with keccak256().
    /// The deposit is only refunded if the bid is above the minimum bid value, 
    /// and that the bid equals the bid in the open round
    function bidInHiddenRound(bytes32 bid) public payable inState(State.ReadyForHiddenBids) isBeforeDeadline(auctionInfo.hiddenBidsDeadline) {
        require(msg.value >= auctionInfo.depositValue, "Deposit value is too low");

        bids[msg.sender] = Bid({
            existsHiddenBid: true,
            hiddenBid: bid,
            openBid: 0,
            isOpenBidValid: false,
            deposit: msg.value * 1 wei
        });

        hiddenBidsAddresses.push(msg.sender);
        emit ReceivedHiddenBid(msg.sender, bid, msg.value, address(this).balance, currentTime());
    }

    function closeHiddenRound() public inState(State.ReadyForHiddenBids) isAfterDeadline(auctionInfo.hiddenBidsDeadline) {
        auctionInfo.currentState = State.ReadyForOpenBids;
        emit ClosedRound("Hidden round", auctionInfo.currentState, currentTime());
    }

    function bidInOpenRound(uint openBid) public inState(State.ReadyForOpenBids) isBeforeDeadline(auctionInfo.openBidsDeadline) {
        require(bids[msg.sender].existsHiddenBid, "This account has not bidden in the hidden round");
        require(openBid >= auctionInfo.minBidValue, "Bid value is too low");

        bytes32 hashedBid = keccak256(abi.encodePacked(openBid));
        require(bids[msg.sender].hiddenBid == hashedBid, "Open bid and hidden bid do not match");

        if (bids[msg.sender].deposit < openBid) {
            // TODO: Must receive more money from bidder!
        }

        bids[msg.sender].isOpenBidValid = true;
        bids[msg.sender].openBid = openBid;
        openBidsAddresses.push(msg.sender);
        emit ReceivedOpenBid(msg.sender, openBid, currentTime());
    }

    function closeOpenRound() public inState(State.ReadyForOpenBids) isAfterDeadline(auctionInfo.openBidsDeadline) {
        auctionInfo.currentState = State.Closed;
        emit ClosedRound("Open round", auctionInfo.currentState, currentTime());
    }

    function closeAuction() public inState(State.ReadyForOpenBids) isAfterDeadline(auctionInfo.openBidsDeadline) {
        auctionInfo.currentState = State.Closed;
        emit ClosedRound("Open round", auctionInfo.currentState, currentTime());

        findWinner();
        transferBackDeposits();
        transferHighestBidToSeller();
        emit AuctionEnded(winnerAddress, bids[winnerAddress].openBid, address(this).balance, currentTime());
    }

    function findWinner() internal inState(State.Closed) {
        address winner;
        uint highestBid;

        for(uint i = 0; i < openBidsAddresses.length; i++) {
            address bidder = openBidsAddresses[i];
            uint bid = bids[bidder].openBid;

            if (bid > highestBid) {
                winner = bidder;
                highestBid = bid;
            }
        }

        winnerAddress = winner;
        winnerBid = highestBid;
        emit FoundHighestBid(winnerAddress, winnerBid, currentTime());

        token[winnerAddress] = Token({
            winner: winnerAddress,
            auctionContract: address(this),
            energyAmount: auctionInfo.energyAmount,
            createdAt: currentTime(),
            validUntil: currentTime() + threeMonths,
            exists: true
        });
    }

    function transferBackDeposits() internal inState(State.Closed) {
        require(winnerAddress != address(0), "Must find a winner before sending back deposits");

        for (uint i = 0; i < hiddenBidsAddresses.length; i++) {
            address payable bidderAddress = payable(hiddenBidsAddresses[i]);
            Bid memory bid = bids[bidderAddress];

            // Do not send back deposit to invalid bidders
            if (!bid.isOpenBidValid) continue; 

            bool isWinner = bidderAddress == winnerAddress;
            uint deposit = isWinner ? bid.deposit - bid.openBid : bid.deposit;

            emit TransferEvent(
                "Transfer back deposit to bidder", 
                bidderAddress, 
                deposit, 
                currentTime()
            );

            bidderAddress.transfer(deposit);
        }
    }

    function transferHighestBidToSeller() internal inState(State.Closed) {
        uint highestBid = bids[winnerAddress].openBid;
        address payable seller = auctionInfo.seller;

        emit TransferEvent(
            "Transfer highest bid to seller",
            seller,
            highestBid,
            currentTime()
        );

        seller.transfer(highestBid);

        // Transfer deposits of invalid bidders to seller
        uint contractBalance = address(this).balance;
        if (contractBalance > highestBid) {
            emit TransferEvent(
                "Transfer contract balance to seller", 
                seller, 
                contractBalance,
                currentTime()
            );

            seller.transfer(contractBalance);
        }
    }

    function retrieveToken() public inState(State.Closed) isAfterDeadline(auctionInfo.openBidsDeadline) returns(Token memory) {
        require(msg.sender == winnerAddress, "You are not the winner of the auction!");

        auctionInfo.currentState = State.TokenRetrieved;
        emit RetrievedToken(msg.sender, currentTime());

        return token[msg.sender];
    }

    function currentTime() internal view virtual returns(uint) {
        return block.timestamp;
    }

    function getAuctionInfo() public view returns(State, address, uint, uint, uint, uint, uint, uint) {
        return (
            auctionInfo.currentState,
            auctionInfo.seller,
            auctionInfo.energyAmount,
            auctionInfo.minBidValue,
            auctionInfo.depositValue,
            auctionInfo.hiddenBidsDeadline,
            auctionInfo.openBidsDeadline,
            auctionInfo.tokenValidUntil
        );
    }

    function getCurrentState() public view returns(State) {
        return auctionInfo.currentState;
    }

    function getTokenValidUntil() public view returns(uint) {
        return auctionInfo.tokenValidUntil;
    }

    function getHiddenBidsLength() public view returns(uint256) {
        return hiddenBidsAddresses.length;
    }

    function getOpenBidsLength() public view returns(uint256) {
        return openBidsAddresses.length;
    }

    function deleteAuction() external {
        require(msg.sender == controller);
        selfdestruct(auctionInfo.seller);
    }
}
